import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Páginas
import Home from './pages/Home'; // Página inicial
import Clientes from './pages/Clientes'; // Página principal de clientes
import CadastroClientes from './pages/CadastroClientes'; // Página de cadastro de clientes
import DetalhesClientes from './pages/DetalhesClientes'; // Página de detalhes de um cliente
import EditarCliente from './pages/EditarCliente'; // Página de edição de um cliente

// Componentes de Orçamentos
import TodosOrcamentos from './components/orcamento/TodosOrcamentos'; // Lista de todos os orçamentos
import CriarOrcamento from './components/orcamento/CriarOrcamento'; // Criar um novo orçamento
import OrcamentosCliente from './components/orcamento/OrcamentosCliente'; // Orçamentos de um cliente específico
import DetalhesOrcamento from './components/orcamento/DetalhesOrcamento'; // Detalhes de um orçamento específico

function App() {
  return (
    <Router>
      <Routes>
        {/* Rota inicial apontando para Home */}
        <Route path="/" element={<Home />} />

        {/* Rotas para clientes */}
        <Route path="/clientes" element={<Clientes />} /> {/* Página principal de clientes */}
        <Route path="/clientes/cadastro" element={<CadastroClientes />} /> {/* Página de cadastro de clientes */}
        <Route path="/clientes/detalhes/:id" element={<DetalhesClientes />} /> {/* Detalhes de um cliente específico */}
        <Route path="/clientes/editar/:id" element={<EditarCliente />} /> {/* Editar um cliente específico */}

        {/* Rotas para orçamentos */}
        <Route path="/orcamentos" element={<TodosOrcamentos />} /> {/* Lista de todos os orçamentos */}
        <Route path="/orcamentos/criar" element={<CriarOrcamento />} /> {/* Criar um novo orçamento */}
        <Route path="/clientes/:id/orcamentos" element={<OrcamentosCliente />} /> {/* Orçamentos de um cliente específico */}
        <Route path="/orcamentos/detalhes/:id" element={<DetalhesOrcamento />} /> {/* Detalhes de um orçamento específico */}
      </Routes>
    </Router>
  );
}

export default App;
